import styled from "styled-components";
import { Button } from "../../../../components/button/Button";
import { theme } from "../../../../styles/Theme";

type ProjectType = {
	bgcImage: string;
	projectTheme: string;
	title: string;
	text: string;
};

export function Project(props: ProjectType) {
	return (
		<StyledProject bgcImage={props.bgcImage}>
			<HeadersProject>
				<ProjectTheme>{props.projectTheme}</ProjectTheme>
				<Title>{props.title}</Title>
			</HeadersProject>

			<Text>{props.text}</Text>
			<Button>View More</Button>
		</StyledProject>
	);
}

type StyledProjectType = {
	bgcImage: string;
};

const StyledProject = styled.div<StyledProjectType>`
	background-image: url(${(props) => props.bgcImage});
	background-position: 100%;
	background-size: cover;

	color: ${theme.color.secondaryBg};
	& {
		margin-bottom: 70px;
	}
	display: flex;
	flex-wrap: wrap;
	gap: 80px;
`;

const ProjectTheme = styled.h2`
	width: 433px;
	height: 24px;
	font-size: 16px;
	font-weight: 600;
	line-height: 150%;
`;

const Title = styled.h3`
	width: 433px;
	height: 162px;
`;

const Text = styled.p`
	width: 433px;
	height: 135px;
`;

const HeadersProject = styled.div`
	width: 433px;
	height: 202px;
`
